const Member = (p) => {
  const { name, age, email } = p;
  return (
    <>
      <div>
        난 {name} 이다. 나이는 {age} 이고 이메일은 {email} 이다
      </div>
      <div>{p.children}</div>
    </>
  );
};
export default Member;
